import React from 'react';

const ServicesPage = () => {
  return (
    <div>
      <h1>Our Services</h1>
      <p>
        Explore our comprehensive range of services designed to meet the diverse needs of our clients. Whether you are
        seeking luxurious real estate options, bespoke business solutions, or specialized medical vacation services, our
        team is dedicated to delivering excellence and exceeding expectations.
      </p>
    </div>
  );
};

export default ServicesPage;
